import React, {Component} from 'react';
import TabComponent from '../tabs/tab';
import SolidTab from '../tabs/tabpanel';
// import HeaderAppBar from '../header/header-appbar';



export default class AppContainer extends Component(props) {
	constructor(props){
		super(props)
		this.state = {

		}
	}
  // console.log('PROPS INSIDE APPBARContainer COMP:' ,props)
    componentDidMount() {
    	const { } = this.props

    fetch('/assets')
    .then(res=> res.json() )
    .then(data => this.setState({ assets: data }))
  }

  render(){
  	  return (
	    <div>
	      <SolidTab data={props.assets}> </SolidTab>
	   </div>  
  )}
}
